from typing import List


class Solution:
    def findLength(self, A: List[int], B: List[int]) -> int:
        counter = [[0] * (len(B) + 1) for _ in range(len(A)+1)]
        maxLength = 0
        for i in range(len(A)-1, -1, -1):
            for j in range(len(B) - 1, -1, -1):
                counter[i][j] = counter[i+1][j+1] + 1 if A[i] == B[j] else 0
                maxLength = max(counter[i][j], maxLength)
        return maxLength




